import { Outlet, useRouteLoaderData } from "react-router-dom";
import EventsNavigation from "./EventsNavigation";

export default function EventsLayout(){
    const token=useRouteLoaderData("main");

    return <>
        {token && <EventsNavigation/>}
        <Outlet/>
    </>
}
